INSERT INTO `utilisateur` (`type_utilisateur`, `id_utilisateur`, `mail_utilisateur`, `mdp_utilisateur`, `nom_utilisateur`, `prenom_utilisateur`, `identifiant_salarie`, `datedesinscription_nonsalarie`, `dateinscription_nonsalarie`, `tel1_nonsalarie`, `tel2_nonsalarie`, `bic_professionnel`, `iban_professionnel`, `identifiant_professionnel`, `raisonsociale_professionnel`, `siret_professionnel`, `descriptionbreve_producteur`, `descriptiondetaillee_producteur`, `photo_producteur`, `tourneeReelleLivraison_id_tournee_theorique`, `tourneeReelleProducteur_id_tournee_theorique`) VALUES ('producteur', 30, 'orzeau@gmail.com', 'orzeau', 'Faure', 'Michel', NULL, NULL, NULL, '01 45 96 20 45', NULL, NULL, NULL, 'orzeau', 'Au délices du Moulin d\'Orzeau', NULL, 'Producteur de miel', 'Nous proposons exclusivement des miels issus de nos ruchers situés à proximité de Tessancourt sur Aubette (VEXIN). Nos miels ne sont à aucun moment chauffés. Aucun sucre ou sirop de glucose/fructose n\'est ajouté à nos miels. Les ruches ne sont jamais soumis aux traitements à base de molécules chimiques (amitraze) contre le varroa. Nous vous proposons des miels de fleurs sauvages, de printemps, du Vexin, de tilleul, de châtaignier ou de chataignier-roncier ainsi que des préparations à base de miel. Nos miels sont liquides, crémeux, ou encore cristallisés suivant les nectars butinés et la saison.', 'producteur_id30.jpg', NULL, NULL);
