INSERT INTO `utilisateur` (`type_utilisateur`, `id_utilisateur`, `mail_utilisateur`, `mdp_utilisateur`, `nom_utilisateur`, `prenom_utilisateur`, `identifiant_salarie`, `datedesinscription_nonsalarie`, `dateinscription_nonsalarie`, `tel1_nonsalarie`, `tel2_nonsalarie`, `bic_professionnel`, `iban_professionnel`, `identifiant_professionnel`, `raisonsociale_professionnel`, `siret_professionnel`, `descriptionbreve_producteur`, `descriptiondetaillee_producteur`, `photo_producteur`, `tourneeReelleLivraison_id_tournee_theorique`, `tourneeReelleProducteur_id_tournee_theorique`) VALUES ('producteur', 36, 'gatinorge@yahoo.fr', 'gatinorge', 'Dufour', 'Grégoire', NULL, NULL, NULL, '01 65 12 45 60', NULL, NULL, NULL, 'gatinorge', 'SARL Gatinorge', NULL, 'Producteur de bières', 'Notre Bière est née du terroir du Gâtinais en lan 2000. A linitiative dun groupe dagriculteurs, producteurs dorge, amoureux de leur métier. Notre but est de valoriser une production régionale de renommée : lorge brassicole du Gâtinais. Notre projet a été de « créer une bière identifiée à un métier et à un terroir ». Du champ dorge à la Gâtine, la traçabilité est assurée. La Gâtine est une bière artisanale, riche en malt, non filtrée, non pasteurisée. La fermentation haute, caractéristique du brassage à lancienne, libère les arômes de la Gâtine. Elle parfait son bouquet grâce à la refermentation en bouteille. La Gâtine est une bière sur lie, légère et digeste, la levure que lon observe dans le fond de la bouteille est symbole de qualité. Notre bière fait partie des produits du terroir de SEINE ET MARNE.', 'producteur_id36.jpg', NULL, NULL);
