INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(1, '2017-09-19 00:00:00', 'Le miel de châtaignier est un produit qui porte le nom de son arbre dorigine. Les Castanea sativa Mill, de la famille des fagacées, comme le chêne et le hêtre, sont de grands producteurs de pollen. Ces arbres sont surtout connus pour secréter du miellat et non du nectar. Or, le châtaignier fait exception à cette règle, par le fait quil secrète du nectar et éventuellement du miellat. Quant à son pollen, très abondant, il se retrouve dans les miels récoltés au printemps.', 'Miel de châtaignier', 'mielChataignier.jpg', 5.95, 50, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(2, '2017-09-19 00:00:00', 'Aux vertus apaisantes, ce miel dun jaune clair ou foncé a un goût fortement mentholé, frais, sans acidité, mais légèrement amer. Issu des fleurs du même nom, le miel de tilleul a un usage reconnu pour traiter les troubles dinsomnie. ', 'Miel de tilleul', 'miel-de-tilleul.jpg', 8.35, 60, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(3, '2017-09-19 00:00:00', 'Le miel de sarrasin est originaire du continent américain. Longtemps considéré comme l\'emblème de la Bretagne, il fut un temps où il a failli disparaitre. Mais aujourd\'hui, il reprend peu à peu du terrain et il est connu surtout comme miel de cru.', 'Miel de sarrasin', 'mielSarrasin.jpg', 9.25, 30, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(4, '2017-09-19 08:42:22', 'Magnifique cuvée exubérante et raffinée en même temps. Arômes de fruits noirs, cacao et épices, bouche savoureuse et franche, très aromatique, avec une belle trame mûre et goûteuse, de l\'élégance et un bel équilibre.', 'La Lionne 2015 Rouge', 'Lionne2015.png', 9.2, 140, 43, 22);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(5, '2017-09-19 08:42:22', 'Robe jaune doré à reflets verts. Le nez est explosif sur les fleurs blanches, les agrumes et le poivron vert bien mûr. Sauvignon de terroir à la forte personnalité, il explose en bouche développant ses arômes dans une trame beurrée, presque poivrée où le poivron vert s\'enrobe de fleurs blanches, de pamplemousse et d\'une pointe anisée. La cuvée longue et fraîche présente un bel équilibre en bouche.', 'La Lionne 2015 Blanc', 'LionneBlanc.jpg', 9.5, 56, 43, 22);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(6, '2017-09-19 00:00:00', 'Robe: pétale de rose. Nez: fraise, framboise, pointe mentholéeINSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(7, '2017-09-19 00:00:00', 'Le brocoli est un véritable délice vert qui se consomme sous tellement de formes et de textures quil est possible de jouer de sa saveur dans quantité de préparations salées.', 'Brocoli', 'Brocolis.jpg', 3.5, 12, 32, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(8, '2017-09-19 00:00:00', 'Le chou romanesco est une magnifique variété de chou-fleur originaire dItalie. Cest un légume-feuille de la famille du chou. Il est plus fin et un léger goût de noix se dégage de cette variété de chou.', 'Chou romanesco', 'chouRomanesco.jpg', 4.5, 15, 34, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(9, '2017-09-19 00:00:00', 'Les haricots mangetout sont une des variétés de haricots verts. On les reconnait à leur gousse allongée sans parchemin et à leur couleur verte ou jaune. Mûrs, ils contiennent des graines tendres, parfois sans fil. ', 'Mange-tout', 'mangeTout.jpg', 2.5, 70, 35, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(10, '2017-09-19 09:01:25', 'La pomme Ariane est à la fois sucrée et acidulée, ferme et croquante, juteuse et pétillante en bouche, pour une saveur authentique. Bicolore, dun rouge profond et brillant  pailleté de lenticelles, Ariane marie élégance et rusticité.', 'Pomme Ariane', 'pommeAriane.jpg', 3.3, 45, 18, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(11, '2017-09-19 09:01:25', 'La Gala est une pomme rouge issue du croisement entre la Kidd\'s Orange Red et la Golden Delicious. La variété a été créée en Nouvelle-Zélande dans les années 1930 par le pépiniériste J.H. Kidd. Elle est disponible de septembre à mai.', 'Pomme Gala', 'PommeGala.jpg', 2.5, 30, 18, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(12, '2017-09-19 09:05:46', 'Disponible de septembre à avril, la poire Conférence est la poire dautomne et dhiver par excellence. Elle a en effet besoin dune période de froid pour se développer. Variété la plus produite en Europe, elle doit son succès à sa tenue lors de laffinage et de la conservation.', 'Poire Conférence', 'PoireConference.jpg', 3.5, 45, 19, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(13, '2017-09-19 09:05:46', 'Un trésor de santé !  Riche en germanium et sélénium, c\'est un aliment précieux pour la santé.  L\'ail violet est une variété d\'automne, productive, précoce, violet. Bonne conservation.', 'Ail violet', 'AilViolet.jpg', 5.9, 75, 30, 25);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(14, '2017-09-19 09:09:46', 'Loignon jaune, parfois appelé oignon paille, est le bulbe dune plante potagère de la famille des alliacés et qui porte le même nom. Le bulbe de loignon est constitué de feuilles claires, très charnues, juteuses et fortes en goût, recouvertes de fines pelures dun jaune plus ou moins foncé.', 'Oignon jaune', 'OignonJaune.jpg', 1.9, 25, 29, 25);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(15, '2017-09-19 09:09:46', 'Délicieux et craquant cru, savoureux et gourmand cuit, le céleri-rave se prépare rapidement et se marie avec tous types de plats, du plus simple au plus élégant. Voici quelques astuces pour apprécier ce légume rustique.', 'Céreri-rave', 'celeri-rave.jpg', 2.5, 45, 28, 25);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(16, '2017-09-19 09:15:08', 'Le raisin Chasselas est un cépage blanc parmi les plus célèbres. Il est aussi bien utilisé comme raisin de table que pour la vinification. Ses grappes plus ou moins lâches sont composées de petits grains jaunes dorés très juteux qui se fendent lorsqu\'on les croque.', 'Raisin blanc Chasselas', 'raisinChasselas.jpg', 4.5, 25, 20, 26);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(17, '2017-09-19 09:15:08', 'Récolté de mi-août jusquà la mi-octobre, ce beau raisin noir offre une grappe généreuse, aérée et très allongée. Son grain est gros à la chaire ferme et juteuse. Sa pulpe ferme et charnue se prête aux tartes et clafoutis !', 'Raisin noir Muscat', 'raisinMuscat.jpg', 6.75, 48, 20, 26);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(18, '2017-09-19 09:38:07', 'C\'est un fruit jaune avec une face rosée à rouge, et une peau très fine agréable en bouche. Cependant, cette dernière particularité la rend fragile à maturité, il faut la manipuler avec précaution. Sa chaire est blanche, juteuse et fondante, extrêmement parfumée et sucrée. On obtient des fruits gros à très gros.', 'Poire Comice', 'PoireComice.png', 3.5, 80, 19, 26);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(19, '2017-09-19 00:00:00', 'Les ufs Label Rouge sont pondus par des poules fermières qui, comme les volailles fermières Label Rouge, sont élevées selon un mode de production fermier, en plein air, dans le respect dun cahier des charges. Ramassés et triés à la main deux fois par jour, la qualité des ufs Label Rouge est régulièrement testée. Un élevage fermier qui change tout !', 'ufs plein air', 'OeufPoule12.jpg', 10.5, 15, 40, 27);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(20, '2017-09-19 00:00:00', 'Petit par la taille, l\'uf de caille est un géant en termes d\'équilibre. La principale caractéristique de l\'uf de caille est qu\'il est l\'uf le plus diététique de la planète, tout du moins en l\'état actuel des connaissances. Il est réputé pour être le symbole de l\'équilibre parfait entre tous ses composants.', 'ufs de caille', 'OeufDeCaille.jpg', 4.5, 41, 41, 27);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(21, '2017-09-19 00:00:00', 'La Harco est une poule calme de caractère, aux multiples qualités : bonne pondeuse, mais aussi bonne couveuse et bonne mèreINSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(22, '2017-09-19 00:00:00', 'Variété précoce cuillie de mi-août à début octobre se présente en grosse grappe à la pulpe croquante et juteuse légérement aromatique.', 'Raisin blanc Danlas', 'raisinDanlas.jpg', 3.95, 20, 20, 28);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(23, '2017-09-19 00:00:00', 'Pomme à couteau à la peau fine et lisse, d\'une belle couleur bicolore rouge et jaune, la pomme Elstar est une variété rustique de taille moyenne. Rafraîchissante, très parfumée, elle est appréciée pour sa chair croquante et juteuse, sucrée et légèrement acidulée. Laissez-vous tenter par cette star du verger.', 'Pomme Elstar', 'PommeElstar.jpg', 2.5, 30, 18, 28);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(24, '2017-09-19 00:00:00', 'Mélange entre la \'Conférence\' et la \'Comice\', la Poire Concorde est très productive, résistante et rustique. C\'est un gros fruit vert-gris qui devient vert-jaune à maturité et roux sur la face au soleil. La peau est mouchetée de tâches brunes. La chair est jaune pâle, juteuse, sucrée, fine et fondante. La maturité débute en octobre et peut se conserver jusqu\'en décembre. Cette poire est aussi idéale pour des desserts.', 'Poire Concorde', 'PoireConcorde.jpg', 3.5, 25, 19, 28);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(25, '2017-09-19 00:00:00', 'De couleur rouge violacée, rose, orangée, jaune, blanche ou rose dont la chair est cerclée danneaux blancs. Il en existe en plusieurs variétés dont des cylindriques, des rondes, des globuleuses, des aplatiesINSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(26, '2017-09-19 00:00:00', 'La carotte Berlicum est une variété tardive formant de belles racines uniformes, orangées de 20 cm de long environ. Bonne texture et qualité gustative. ', 'Carotte Berlicum', 'CarotteBerlicum.jpg', 3.95, 15, 27, 29);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(27, '2017-09-19 10:11:33', 'Le persil plat aux feuilles lisses mesure lui jusquà 45 cm Sa saveur très parfumée est moins amère que le persil frisé.', 'Persil plat', 'persilPlat.jpg', 2, 16, 39, 29);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(28, '2017-09-19 10:11:33', 'Sa texture onctueuse, sa teinte claire et son goût délicat caractérisent le miel de lavande qui possède des vertus antiseptiques et anti-inflammatoires. ', 'Miel de lavande', 'mielLavande.jpg', 9.5, 25, 4, 30);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(29, '2017-09-19 10:17:49', 'Jaune pâle à ambre. Très clair à l\'état solide.  Parfum et saveur du miel d\'aubépine Arôme discret mais tenace. Le goût suave et fruité perdure en bouche.', 'Miel d\'aubépine', 'mielAubepinejpg.jpg', 7.5, 15, 4, 30);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(30, '2017-09-19 10:17:49', 'Comme nutriment, pas dutilisation véritable en médecine mais un remède idéal à fabriquer avec un goût très agréable. Certains spécialistes estiment toutefois que ce miel pourrait être utilisé contre la toux voire lasthme.', 'Miel de pissenlit', 'mielPissenlit.jpg', 9.5, 23, 4, 30);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(31, '2017-09-19 10:24:01', 'La poule Sussex doit son nom à son origine, le comté de Sussex dans le sud de lAngleterre. Très reconnaissable grâce à son plumage blanc et fourni ainsi quà sa collerette herminée noire.', 'ufs de poule Sussex', 'oeufsSussex.jpg', 3.5, 15, 40, 31);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(32, '2017-09-19 10:24:01', 'La Poule rousse fermière, issue dune longue sélection, est une pondeuse fermière particulièrement productive.', 'ufs de poule Rousse', 'oeufsRousse.jpg', 2.5, 15, 40, 31);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(33, '2017-09-19 10:32:06', 'La poule Vorwerk est placée troisième dans notre top 10 des poules pondeuses. Dorigine Allemande, elle est le fruit de plusieurs races : la lakenvelder, lorpington, la ramelsloher et lAndalouse. Elle a été créé créée dans les années 1900 par  Oskar Vorwerk dont elle porte aujourdhui le nom.', 'ufs de poule Vorwerk', 'oeufVorwerk.jpg', 12.5, 30, 40, 31);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(34, '2017-09-19 10:32:06', 'Variété rustique fournissant des grosses têtes larges avec des écailles étalées, bien charnues, entièrement vert pâle sauf à la base où elles sont légèrement teintées de violet. Variété résistante au froid à condition de bien protéger le pied pendant lhiver avec de la paille ou une bâche. ', 'Artichaut Camus', 'ArtichautCamus.jpg', 3.6, 15, 34, 32);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(35, '2017-09-19 00:00:00', 'Avec ses fleurettes blanches et nuageuses qui n\'écloront jamais, le chou-fleur renferme une richesse nutritionnelle et culinaire encore trop peu connueINSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(36, '2017-09-19 10:48:58', 'Surnommée doucette, la mâche est un légume à feuilles tendres et à saveur délicate. Ce nest pas une laitue; elle appartient à la même famille que la valériane.Elle renferme beaucoup de bêta-carotène, un antioxydant qui se transforme en vitamine A dans lorganisme.', 'Mâche', 'MacheVerte.jpg', 2.1, 13, 36, 32);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(37, '2017-09-19 00:00:00', 'Le lait entier serait une source plus importante de vitamine D et permettrait de prévenir le surpoids et l\'obésité durant la petite enfance.', 'Lait entier', 'LaitEntier.jpg', 4.5, 56, 16, 37);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(38, '2017-09-19 11:38:48', 'Le lait demi-écrémé fait toute la différence au niveau de sa teneur en matières grasses. \"Comptez 1,6 g de lipides pour 100 ml contre 3,2 g pour sa version entière\".', 'Lait demi-écrémé', 'LaitDemi-Ecreme.jpg', 2.5, 34, 16, 33);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(39, '2017-09-19 11:38:48', 'Le lait écrémé est lune des 3 variétés de lait, après le lait entier et le lait demi-écrémé. Comme son nom lindique, ce lait est entièrement débarrassé de sa matière grasse, de sa crème. Ainsi, un lait est dit écrémé, quand sa teneur en lipides est inférieure à 0,5 g pour 100 ml. Ce faible taux en matières grasses explique que le lait écrémé soit le lait le moins calorique de tous.', 'Lait écrémé', 'LaitEcreme.jpg', 4.1, 65, 16, 33);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(40, '2017-09-19 11:45:41', 'Riche en vitamine C, cicatrisant, astringent, fortifiant et antiseptique renforçant vos défenses immunitaires, les propriétés du citron ne sont plus à démontrer.', 'Citron jaune', 'citronJaune.jpg', 2.5, 36, 21, 34);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(41, '2017-09-19 11:45:41', 'La quetsche ou prune de Damas, est le fruit d\'une des variétés du prunier de Damas.', 'Quetsche', 'Quetsche.jpg', 4.55, 45, 22, 34);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(42, '2017-09-19 11:50:18', 'C\'est la fin de l\'été, la mirabelle, petite prune jaune originaire de la région Lorraine, donnera tout son parfum aux confitures, tartes et autres desserts. Vous pouvez aussi tenter l\'eau de vie, mais avec modération !', 'Mirabelle', 'mirabelle.jpg', 3.95, 16, 22, 34);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(43, '2017-09-19 11:57:37', 'Excellente pomme à couteau, sa chair de couleur blanche-crème renferme des saveurs subtiles et délicates. Douce, acidulée et parfumée, elle saura inévitablement charmer les curieux. À croquer sans modération à pleines dents.', 'Pomme des Reines', 'pommeReinette.jpg', 3.5, 45, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(44, '2017-09-19 00:00:00', 'Bonne variété. Joli gros fruit rond à chair croquante et juteuse gout acidulé. Pomme de table savoureuse.', 'Pomme Elstar', 'pommeElstar2.jpg', 2.5, 12, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(45, '2017-09-19 00:00:00', 'Les qualités gustatives de la poire Williams sont reconnues : sucrées et parfumées avec une chair fine, juteuse et fondante, la résistance aux manipulations est moyenne, comme pour la plupart des variétés de poires. La maturité des fruits évolue rapidement surtout après sortie de frigo. La poire Williams est utilisée aussi bien pour la transformation (compote, poires au sirop ou distillerie) que pour la consommation en frais.', 'Poire Williams', 'poireWilliams.jpg', 2.75, 36, 19, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(46, '2017-09-19 12:08:34', 'La Gâtine blanche est une bière de dégustation légère, rafraichissante et désaltérante, avec un léger goût de citron. Elle révèle toutes ses saveurs à une température de 4-6 degrés.', 'La Gatîne blanche', 'gatineBlanche.jpg', 4.31, 45, 42, 36);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(47, '2017-09-19 12:18:01', 'La Gâtine blonde est une bière de dégustation légère ou l\'on retrouve bien les arômes d\'une bière artisanale, le malt et le houblon avec une touche de miel. Elle révèle toutes ses saveurs à une température de 6-8 degrés.', 'La Gatîne Blonde', 'GatineBlonde.jpg', 4.46, 56, 42, 36);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(48, '2017-09-19 12:18:01', 'La Gâtine brune est une bière de dégustation de caractère, elle utilise des malts torréfiés qui lui confèrent son goût fumé. Elle révèle toutes ses saveurs à une température de 8-10 degrés.', 'La Gatîne brune', 'gatineBrune.jpg', 2.36, 20, 42, 36);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(49, '2017-09-19 12:41:08', 'Le lait entier serait une source plus importante de vitamine D et permettrait de prévenir le surpoids et l\'obésité durant la petite enfance.', 'Lait entier', 'laitEntier2.jpg', 8.5, 12, 42, 37);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(50, '2017-09-19 12:41:08', 'Le lait demi-écrémé fait toute la différence au niveau de sa teneur en matières grasses. \"Comptez 1,6 g de lipides pour 100 ml contre 3,2 g pour sa version entière\".', 'Lait demi-écrémé', 'laitDemiEcreme2.jpg', 2.3, 52, 16, 37);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(51, '2017-09-19 12:48:39', 'Le lait écrémé est lune des 3 variétés de lait, après le lait entier et le lait demi-écrémé. Comme son nom lindique, ce lait est entièrement débarrassé de sa matière grasse, de sa crème. Ainsi, un lait est dit écrémé, quand sa teneur en lipides est inférieure à 0,5 g pour 100 ml. Ce faible taux en matières grasses explique que le lait écrémé soit le lait le moins calorique de tous.', 'Lait écrémé', 'laitecreme2.jpg', 2.1, 23, 16, 37);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(52, '2017-09-19 00:00:00', 'Rare sur les étals, la noisette fraîche est un fruit à ne pas manquer ! Son goût est subtil et légèrement lacté, tandis que sa texture se révèle très raffinée. Succombez aussi au croquant fruité de la noisette sèche ! Fruit gourmand, la noisette possède en prime d\'excellentes qualités nutritionnelles.', 'Noisette', 'Noisette.jpg', 5.95, 30, 25, 38);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(53, '2017-09-19 00:00:00', 'Les noix sont associées à plusieurs bienfaits pour la santé. Comme les autres fruits à coque, elles permettent de faire baisser le taux de cholestérol sanguin, de lutter contre les maladies cardiovasculaires et contre le diabète de type 2.', 'Noix', 'noix.jpg', 6.95, 10, 24, 38);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(54, '2017-09-19 00:00:00', 'Ronde et verte à reflets dorés on la trouve dès le mois de juillet pour certaines variétés. Sa chair est ferme, très juteuse, sucrée et parfumée.', 'Reine-claude', 'reineclaude.jpg', 3.95, 12, 23, 38);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(55, '2017-09-19 00:00:00', 'Le cèpe, à linstar de tous les champignons sauvages, est consommé depuis des siècles. Sa saveur est tellement exceptionnelle quil est très attendu et convoité, dès le début de lautomne, sur les étals. Ces petits « bouchons » gorgés de vitamines sont délicieux cuisinés simplement, ou intégrés à des recettes plus élaborées, voire à des plats de fête.', 'Cèpes', 'cepes.jpg', 14, 15, 44, 39);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(56, '2017-09-19 00:00:00', 'De la famille des Morchellacées, la morille (Morchella) est un champignon de printemps, qui fait partie des plus convoités pour son goût à la fois très particulier et très fin. Un petit peu comme la truffe, elle fait partie des champignons de prestige, sans doute aussi du fait de son caractère capricieux concernant ses apparitions ! ', 'Morilles', 'morilles.jpg', 7.5, 30, 44, 39);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(57, '2017-09-19 00:00:00', 'Le basilic est une herbe aromatique incontournable, synonyme à lui tout seul de la cuisine de l\'été.', 'Basilic', 'Basilic.jpg', 2, 25, 38, 39);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(58, '2017-09-19 00:00:00', 'Vin non boisé qui exprime toute la fraicheur et la minéralité du terroir des Roques.', 'Le Vin des Noces 2008', 'vindeNoces2008.jpg', 14.5, 25, 43, 40);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(59, '2017-09-19 00:00:00', 'Sanguis Christi est un vin structuré, puissant, qui révèle toute lélégance du Malbec sur le terroir des Roques.', 'Sanguis Christi 2011', 'sanguis-christi.png', 25, 56, 43, 40);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(60, '2017-09-19 13:53:17', 'Couleur rose foncé. Nez sur des fruits rouges et bonbons Anglais.', 'Rosé de Marie 2009', 'rose-de-marie.png', 35.2, 45, 43, 40);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(61, '2017-09-19 13:53:17', 'L\'échalote s\'utilise aussi bien crue que cuite, en condiment aussi bien qu\'en légume. Sa saveur marquée, utilisée pour relever certaines préparations peut aussi se faire douce et suave, notamment lorsque l\'échalote est lentement confite au four ou fondue dans le beurre.', 'Echalote rose', 'EchaloteRose.jpg', 2.55, 15, 31, 41);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(62, '2017-09-19 00:00:00', 'Cette variété rustique et résistante au froid est idéale pour les récoltes d\'hiver. Ces poireaux ont un gros fût de longueur moyenne avec un feuillage bleuté. Indispensable dans la soupe, le poireau se consomme aussi en salade, tarte ou gratins.', 'Poireau bleu', 'PoireauBleu.jpg', 2.5, 14, 37, 41);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(63, '2017-09-19 00:00:00', 'Cest en cuisant, à leau ou à la vapeur, que le haricot dévoile ses saveurs. Selon vos envies, mangez-le aussi bien chaud que froid, en salade, dans une jardinière de petits légumes, avec de la crème ou encore en velouté', 'Haricot vert', 'HaricotsVerts.jpg', 2.5, 15, 35, 41);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(64, '2017-09-19 00:00:00', 'Le Miel de Forêt est brun foncé, le plus souvent liquide, l\'arôme est bien marqué. Il est élaboré par les abeilles à partir du miellat de pucerons.', 'Miel de forêt', 'mielForet.jpg', 9.5, 45, 4, 42);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(65, '2017-09-19 00:00:00', 'Miel multifloral, de couleur ambrée, issu des fleurs des vallées, au parfum doux et léger, riche en oligo-éléments en raison de la diversité des fleurs butinées. Il peut cristalliser à la longue.', 'Miel multifleurs', 'mielMultifleurs.jpg', 7.5, 65, 4, 42);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(66, '2017-09-19 00:00:00', 'Le miel de tilleul bio est un miel très réputé pour apaiser l\'organisme. Il est conseillé de le déguster avec une infusion du soir pour profiter de tous ses bienfaits.', 'Miel de tilleul', 'mielTilleul.jpg', 10.5, 78, 4, 42);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(67, '2017-09-19 00:00:00', 'La Poule rousse fermière, issue dune longue sélection, est une pondeuse fermière particulièrement productive.', 'ufs de poule', 'oeufRousse2.jpg', 7.5, 45, 17, 43);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(68, '2017-09-19 00:00:00', 'L\'uf de caille est très petit et donne à vos entrées ou à vos amuse bouche un coté très chic.', 'ufs de caille', 'oeufsCaille2.jpg', 7.5, 59, 17, 43);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(69, '2017-09-19 00:00:00', 'La Gournay est une race de poule locale, très rustique.', 'ufs de poule', 'oeufGournay.jpg', 3.5, 42, 17, 43);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(70, '2017-09-19 00:00:00', 'Ce vin rouge croquant et gourmand a été vinifié avec des raisins provenant dune seule parcelle cultivée en agriculture Biologique.', 'Turbigo 2016', 'Turbigo-2016.png', 15, 45, 43, 44);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(71, '2017-09-19 00:00:00', '  Ce vin blanc aromatique et frais a été vinifié à partir de raisins cultivés en biodynamie.', 'Lutèce 2016', 'Lutece-2016.png', 17, 15, 43, 44);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(72, '2017-09-19 00:00:00', '  Ce rosé issue de Cinsault et Grenache a été vinifié grâce à des raisins issus dune parcelle cultivée en Agriculture Biologique.', 'Sequana 2016', 'Sequana-2016.png', 18, 18, 43, 44);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(73, '2017-09-19 11:50:18', 'C\'est une pomme à couteau qui se consomme de manières très diverses, crue ou cuite, d\'octobre à mai, et même jusqu\'en juillet. On la conserve quelques jours à température ambiante, ou un peu plus longtemps dans le bac à légumes du réfrigérateur.', 'Pomme Golden', 'PommeGolden.jpg', 2.5, 30, 18, 34);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(74, '2017-09-19 12:02:53', 'Puissant anti-oxydant et cocktail de vitamines, il boostera votre organisme à moindre prix !', 'Jus de pommes', 'JusDePomme.jpg', 4.5, 25, 6, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(75, '2017-09-19 00:00:00', 'Le jus de poire est une boisson réalisée à partir de poires. Ce jus de fruits, servi froid, est généralement épais et trouble.  Par fermentation du jus de poire, on obtient le poiré. Le jus de poire est également à la base de la production du vin cuit suisse ainsi que du Birnenhonig, sirop épais de Suisse centrale. C\'est aussi un ingrédient du sirop de Liège.', 'Jus de poire', 'JusDePoire.jpg', 6.5, 20, 6, 26);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(76, '2017-09-19 00:00:00', 'La girolle est un champignon comestible très apprécié, qui fait partie du groupe des chanterelles.', 'Girolles', 'girolles.jpg', 14.5, 12, 44, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(77, '2017-09-19 00:00:00', 'Beau et bon, le potiron ne passe pas inaperçu. Ses saveurs se fondent à merveille dans toutes les préparations culinaires. Doux et onctueux, il affirme son caractère. Représentant dune cuisine rustique, il gagne ses lettres de noblesse au côté des aliments les plus fins.', 'Potiron', 'potiron.jpg', 3.55, 14, 45, 32);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(78, '2017-09-19 10:38:16', 'Le potimarron est une variété de courge voisine du potiron. Sa forme et son goût lui ont valu le surnom de courge châtaigne. Cuisinée en gratin comme ici, cest un délice. Il est très riche en vitamines A, B, C, D, E, en oligo-éléments (phosphore, calcium, magnésium, fer, potassium, silicium, sodiumINSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(79, '2017-09-19 12:08:34', 'La châtaigne est riche en minéraux et oligo-éléments. Elle apporte en effet 10 à 15 % de l\'apport journalier recommandé en magnésium, 15 à 20 % de l\'AJR en manganèse et 10 % de l\'AJR en cuivre.', 'Châtaigne', 'chataigne.jpg', 4.5, 12, 46, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(80, '2017-09-19 00:00:00', 'Salade craquante et tendre, dotée d\'une grosse pomme vert clair ou vert jaune, gaufrée, avec les bords découpés, au goût légèrement sucré. Certaines variétés sont parfois rougeâtres.', 'Batavia', 'batavia.jpg', 2, 15, 36, 39);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(81, '2017-09-19 00:00:00', 'La laitue feuille de chêne est tendre et savoureuse à la dégustation. Elle se mange crue comme une salade, mais peut également être dégustée cuite ou braisée.', 'Feuille de chêne', 'feuilleChene.jpg', 2.5, 15, 36, 39);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(82, '2017-09-01 00:00:00', 'Cuisine et pour la pâtisserie.\r\nCalibre moyen à gros. Demi-croquante, juteuse, douce, sucrée, acidulée', 'Pomme Idared', 'pommeIdaredG.jpg', 2.57, 2000, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(83, '2017-09-01 00:00:00', 'Fruit de table\r\nCalibre gros à très gros. croquante, juteuse, très sucrée', 'Pomme Jonagold', 'pommeJonagoldG2.jpg', 3.5, 800, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(84, '2017-09-01 00:00:00', 'Cox\'s Orange Pippin (parfois abrégé en Cox orange) est comme le nom l\'indique (Pippin) une pomme de reinette.\r\nCette variété est depuis plus d\'un siècle une des cinq variétés les plus utilisées par les obtenteurs pour créer de nouvelles variétés.', 'Pomme Cox', 'pommeCoxG.jpg', 2.89, 650, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(85, '2017-09-01 00:00:00', 'Pomme très parfumée, sucrée.\r\nElle est à croquer ou à cuisiner.', 'Pomme Belchar Chantecler', 'pommeBelcharG.jpg', 3.2, 780, 18, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(86, '2017-09-01 00:00:00', 'En 1855, à Rouen, le pépiniériste Louis Boisbunel a l\'idée de croiser une poire avec un coing. Leur enfant est la passe-crassane. Elle a hérité d\'un peu de la physionomie de son « père » : elle est très joufflue, presque ronde, parfois bosselée. Sa peau est jaune marbrée d\'ocre. La passe-crassane est généralement reconnaissable au bouchon de cire rouge qui orne l\'extrémité de sa queue.', 'Poire Passe Crassane', 'poireCrassane.jpg', 4.5, 320, 19, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(87, '2017-09-01 00:00:00', 'La Conférence est un cultivar de poire d\'automne qui doit son nom au fait qu\'elle remporta le premier prix à la conférence internationale de la poire à Londres en 1885. Elle ressemble beaucoup à la poire Beurré Bosc.', 'Poire conférence', 'poireConferenceG.jpg', 3.9, 420, 19, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(88, '2017-09-01 00:00:00', 'Jus de poire de Normandie\r\n100% pur jus de poire pasteurisé', 'Jus de poire', 'jusPoireG.jpg', 4.9, 120, 6, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(89, '2017-09-01 00:00:00', 'On en fait des desserts bons à croquer.\r\nElles sintègrent facilement dans plusieurs plats, quelles rehaussent tant sur le plan de la saveur que de la valeur nutritive.', 'Noix', 'jusPoire.jpg', 0, 13, 24, 35);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(90, '2017-09-01 00:00:00', 'La noisette parfois appelée noisette de Byzance, aveline ou coudre, est le fruit du noisetier commun, le Coryllus avellana. Il tient son nom de la province dAvellino, dans la région de la Campanie au Sud de lItalie, où il est toujours cultivé. Dès lAntiquité, les Grecs et les Romains consommaient des noisettes, tant pour leurs qualités nutritionnelles que pour leurs propriétés médicinales.', 'Noisettes', 'noisettesG.jpg', 23.9, 80, 25, 35);
