INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (1, 'Temps de préparation : 10 min. Temps de cuisson : 10 min. Laver la mâche et les pousses d\'épinard. Réserver. Découper des lamelles d\'Ossau-Iraty. Éplucher les échalotes, les émincer. Passer les champignons sous l\'eau et les essuyer rapidement sur un papier absorbant. Les couper en morceaux. Dans une poêle, faire revenir les échalotes dans le beurre mousseux. Ajouter les champignons. Pour la vinaigrette : Dans un bol, réunir la fleur de sel, le poivre et le vinaigre. Mélanger. Ajouter le miel et l\'huile de noisette. Mélanger de nouveau puis réserver. Dans un beau saladier ou sur des assiettes, disposer le mélange de salade. Déposer les champignons tièdes, parsemer de noisettes et des lamelles de fromage. Au moment de servir, arroser de vinaigrette.', 'Salade en chaud-froid de champignons aux echalotes', 'pour 4 personnes', 'saladechampi.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (2, 'Temps de préparation : 10 min. Temps de cuisson : 20 min. Peler et émincer loignon rouge. Peler les poires et découper la chair en gros cubes. Verser 1 cuillerée à soupe dhuile dolive dans une casserole et faire blondir les oignons. Ajouter les poires et laisser cuire à nouveau 2 minutes. Saupoudrer de paprika, ajouter les châtaignes et 30 cl deau. Laisser cuire 15 minutes. Ajouter la crème, saler et poivrer. Mixer pour obtenir un mélange onctueux. Goûter et rectifier, si nécessaire, lassaisonnement en sel, poivre et paprika. Servir très chaud avec des pignons de pin et des toasts de bleu.', 'Creme de poires et chataignes au paprika', 'pour 4 personnes', 'cremepoire.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (3, 'Temps de préparation : 10 min. Temps de cuisson : 20 min. Détacher les brocolis en bouquets, les plonger 30 secondes dans de leau bouillante salée, les égoutter aussitôt, puis les plonger dans un saladier deau glacée, les laisser refroidir environ 5 minutes et les égoutter à nouveau. Peler les carottes et les râper en minces filets. Décortiquer les crevettes. Râper la moitié du zeste du citron sur une râpe fine au-dessus dun bol. Mélanger le jus dorange et 2 cuillerées à soupe de jus de citron dans le bol, ajouter lhuile, saler et fouetter le mélange. Détailler les bouquets de brocolis en lamelles (les plus minces possible) et les poser à plat sur quatre assiettes. Ajouter les crevettes, napper de sauce et poivrer juste avant de déguster.\r\n', 'Brocolis et crevettes en carpaccio', 'pour 4 personnes', 'brocolicrevette.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (4, 'Temps de préparation : 45 min. Temps de cuisson : 20 min. Pour la crème de champignons : Émincer l\'oignon, l\'ail et les clous de girofle, faire suer le tout à feu doux, y ajouter les parures de champignons puis les liquides. Recouvrir dun couvercle et cuire le tout pendant 30 à 35 minutes. Une fois cuit, mixer le tout, passer à la fine passoire. Récupérer 40 cl de ce liquide et le mélanger au kappa, amener le tout à ébullition, mixer et verser dans les assiettes de service. Filmer et réserver à température ambiante. Pour le velouté de potiron : Couper le potiron en petits cubes et les déposer dans une casserole, couvrir d\'un couvercle et laisser à feu très doux 20 minutes afin de faire ressortir leau de cuisson. Y ajouter le reste de la garniture ainsi que le liquide. Cuire 30 minutes, mixer et passer à la passoire fine. Réserver au chaud. Laver soigneusement les champignons au pinceau. Et réserver au frais. Pour le dressage :\r\nPoêler les champignons à lhuile dolive, les assaisonner de fleur de sel. Puis les déposer sur la crème de champignons. Parsemer de copeaux dAppenzeller® ou servir avec une ou deux pointes de fromage Appenzeller® et proposer le velouté de potiron chaud à part.', 'Creme de champignon Appenzeller veloute de potiron', 'pour 8 personnes', 'cremechampi.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (5, 'Temps de préparation : 20 min. Temps de cuisson : 20 min. Crème parmesan : Pour la crème parmesan, faire suer les oignons dans le beurre, déglacer au vin blanc et réduire de deux tiers, ajouter la crème, mixer et incorporez le parmesan préalablement râpé. Réserver à température ambiante. Crème de chou-fleur grillé : Parer les choux, une fois cuit, faire colorer dans 20 g de beurre a couvert en prenant soin de les colorer uniformément.\r\nMouiller avec le bouillon de légumes et laisser cuire 10 minutes à frémissement. Ajouter la crème et mixer. Assaisonner de sel et sucre. Réserver à température ambiante. Cuisson : Faire fondre le beurre dans un sautoir, y déposer le chou et larroser sans cesse en augmentant la température au fur et à mesure de façon à ce qu\'il soit coloré à lextérieur et fondant a lintérieur. (10 mn.) Finition et dressage : Dresser harmonieusement en prenant soin de disposer deux belles quenelles des deux crèmes. Disposer le chou-fleur entre chaque quenelle, puis déposer les feuilles de menthe bergamote.', 'Chou-fleur croustillant ', 'pour 4 personnes', 'choufleur.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (6, 'Temps de préparation : 20 min. Temps de cuisson : 1h30. Préparation de la volaille : Allumer le four à 180°C th. 6 Brosser la truffe et la couper en fines lamelles (réserver les petits morceaux pour les légumes). Décoller la peau de la volaille, glisser entre chair et peau les lamelles de truffe et la ficeler. Poser la poularde dans un grand plat à four, peler les oignons, les couper en deux, les poser dans le plat, glisser au four et laisser cuire 30 minutes. Préparation des légumes : Peler et laver tous les légumes. Couper les navets en deux, le potimarron en tranches de 2 cm, les carottes et les panais en tronçons de 5 cm. Lorsque le poulet aura cuit 30 minutes, répartir les légumes autour, saler, verser dans le plat 1 dl deau et parsemer de brins de thym. Cuisson et finissions : Remettre le plat au four, laisser cuire encore 40 minutes et tourner les légumes de temps en temps.', 'Volaille truffee et legumes dautomne', 'pour 6 personnes', 'volaillehiver.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (7, 'Temps de préparation : 15 min. Temps de cuisson : 10 min. Préparation des magrets : Inciser la peau des magrets en faisant des croisillons, les saler et poivrer des deux côtés. Verser le miel dans une casserole, porter à ébullition, ajouter les épices (cardamome, coriandre, anis, genièvre, cannelle, poivre) et laisser cuire 2 minutes. Cuisson des magrets : Faire chauffer une poêle antiadhésive sans matière grasse, et, lorsquelle est bien chaude, y poser les magrets côté peau dessous afin que la graisse fonde. Laisser cuire 5 minutes, puis les retourner, laisser cuire 3 minutes et jeter le gras rendu. Verser le miel et les épices sur les magrets, les rouler dans le miel, et laisser cuire encore 2 minutes.', 'Magret de canard au miel epice', 'pour 4 personnes', 'canardmiel.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (8, 'Temps de préparation : 10 min. Temps de cuisson : 0 min. Tailler finement les pommes en lamelles, laisser sécher la salade verte et les lamelles pendant 20 minutes au four à 180°C. \r\nPréparation de vinaigrette : Faire bouillir pendant 3 minutes deux abricots secs dans un peu deau. Égoutter les abricots, et les mixer avec 5 cl dhuile de noisette, un trait de vinaigre de banyuls, salez et saupoudrer de poivre de Sarawak.', 'Feuille de chene aux chips de pommes', 'pour 2 personnes', 'saladepomme.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (9, 'Temps de préparation : 15 min. Temps de cuisson : 25 min. Préparation de la garniture : Peler le gingembre, le couper en fins bâtonnets. Dénoyauter les pruneaux, les hacher ainsi que les abricots secs. Peler les pommes et les couper en lamelles de 1 cm dépaisseur. Faire fondre le beurre dans une sauteuse, ajouter le sucre, les lamelles de pomme, le gingembre, faire cuire 10 minutes en mélangeant souvent. Ajouter les fruits secs, mélanger, laisser cuire 2 minutes, puis retirer du feu. Casser les amandes et les givrettes en gros morceaux, les ajouter à la préparation et mélanger. Préparation de la pâte : Allumer le four à 210 °C (th. 7). Casser luf en séparant le blanc du jaune. Mettre ce dernier dans un bol avec 1 cuillerée à soupe deau et fouetter. Mettre la pâte dans le moule avec son papier sulfurisé en la laissant déborder largement. Déposer la préparation en forme de dôme sur la pâte, rabattre les bords vers le centre en les plissant et badigeonner de jaune duf. Mettre au four et laisser dorer 15 à 20 minutes. Retirer du four, ajouter la gelée de coing sur les fruits chauds, au contact desquels elle fond. Servir chaud ou tiède, accompagné de crème fouettée.', 'Tourte aux pommes, aux fruits secs et aux amandes', 'pour 6 personnes', 'tourtepomme.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (10, 'Temps de préparation : 20 min. Temps de cuisson : 20 min. Préparation de la pâte : Allumer le four à 210 °C (th 7). Beurrer les moules. Mixer les noix jusquà lobtention dune grosse semoule. Casser les ufs en séparant les blancs des jaunes, mettre ces derniers dans un saladier. Ajouter le sucre, fouetter le mélange durant 1 minute, lui ajouter les noix mixées. Fouetter les blancs en neige, les incorporer délicatement à la préparation aux noix en alternance avec la farine, répartir la pâte dans les deux moules beurrés, lisser la surface, glisser au four et laisser cuire 12 minutes environ, jusquà ce que la surface soit juste dorée. Retirer du four et démouler délicatement les disques de pâte (car ces gâteaux sont souples) sur une grille à pâtisserie. Préparation de la crème : Mixer finement les amandes et les cerneaux de noix avec 50 g de sucre. Fouetter les jaunes et le sucre restant, ajouter le mélange aux noix et mélanger, incorporer les blancs battus en neige. Verser la crème dans une casserole, la poser sur feu doux et faire cuire 10 minutes environ, en tournant souvent, jusquà ce que la préparation épaississe. Retirer du feu et laisser tiédir. Dressage : Poser un disque de pâte sur un plat, étaler dessus la crème encore tiède, recouvrir du second disque de pâte en appuyant légèrement, laisser complètement refroidir. Avant de servir, poser sur le gâteau quelques cerneaux de noix, poudrer de sucre glace et ajouter une ou deux feuilles dor.', 'Gateau tout noix', 'pour 6 personnes', 'gateaunoix.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (11, 'Temps de préparation : 30 min. Temps de cuisson : 10 min. Lavez et égrappez le raisin, étalez les grains sur un plateau et entreposez-les 30 minutes au congélateur. Plantez un cure-dents dans la partie charnue de chaque amande, sans trop l\'enfoncer. Dans une petite casserole, faites un caramel à sec sur feu moyen-vif. Dès qu\'il prend une belle couleur dorée, trempez les amandes dedans, à plusieurs reprises, jusqu\'à ce qu\'elles s\'enrobent entièrement. Maintenez-les quelques instants au-dessus de la casserole jusqu\'à ce qu\'un fil se forme. Déposez-les au fur et à mesure sur un plat huilé et laissez durcir. Recommencez ainsi pour toutes les amandes. Lorsque le caramel a bien pris, retirez délicatement les cure-dents. Servez les raisins glacés dans des coupes, sur un lit de glace pilée et accompagnez-les des amandes caramélisées.', 'Salade de raisins blancs et amandes caramelisees', 'pour 6 personnes', 'raisin.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES (12, 'Temps de préparation : 15 min. Temps de cuisson : 25 min. Préchauffez le four th 6 ( 180°). Garnissez un moule rectangulaire avec la pâte en conservant le papier sulfurisé. Epluchez les poires, coupez les en deux, évidez le cur et retirez la queue. Arrosez-les avec le jus du citron. Mélangez le mascarpone avec les ufs et le sucre semoule. Tapissez le moule avec cette préparation et rangez les poires en les enfonçant tête-bêche. Saupoudrez la tarte damandes hachées et de sucre glace. Enfournez et laissez cuire 25 minutes en surveillant la coloration. Servez tiède.', 'Tarte a la poire et au mascarpone', 'pour 6 personnes', 'tartepoire.jpg', 3);
